  `orderReceivedDate` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `orderCancellationDate` datetime DEFAULT NULL,
  `address` text COLLATE utf8mb4_unicode_ci,
  `trackingNo` varchar(225) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `StyleNo` varchar(225) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `Size` varchar(225) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `quantity` varchar(225) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `size_country` varchar(225) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` int NOT NULL DEFAULT '0',
  `retailerId` int DEFAULT NULL,
  `favouriteOrderId` int DEFAULT NULL,
  `stockOrderId` int DEFAULT NULL,
  `ppt_path` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `payment_status` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT 'Pending',
  `balance_pending` datetime DEFAULT NULL,
  `phoneNumber` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_6de3e65fa0d20f048ded5e7aa9` (`purchaeOrderNo`),
